import axios from "axios";
export function retrieveHelloWorldBean() {
  return axios.get("http://localhost:8080/hello-world-bean");
}

export const retrieveHelloWorldBeanWithPathVariable = (username) => axios.get(`http://localhost:8080/hello-world/path-variable/${username}`);
